import React, { Component } from 'react';



class Form extends Component {
    
    render() { 
        return (
            <div>
                <form method='POST'>
                    <input type='input' placeholder='username'/>
                    <input type='password' placeholder='password'/>
                </form>
            </div>
          );
    }
}
 
export default Form ;
